Actionscript.script:
_parent.手雷动作类型 = _parent.手雷动作类型 ? _parent.手雷动作类型 : "";
_parent.手雷抛出模式 = _parent.手雷抛出模式 ? _parent.手雷抛出模式 : "高抛";
跳转帧 = _parent.手雷动作类型 + _parent.手雷抛出模式;
this.gotoAndPlay(跳转帧);

function 射击()
{
	_parent.手雷射击次数++;
	var 手雷属性 = _parent.手雷属性;
	var 子弹属性 = new Object();
	子弹属性.声音 = 手雷属性.sound;
	子弹属性.霰弹值 = 手雷属性.split;
	子弹属性.子弹散射度 = 手雷属性.diffusion;
	子弹属性.发射效果 = 手雷属性.muzzle;
	子弹属性.子弹种类 = 手雷属性.bullet;
	子弹属性.子弹威力 = 手雷属性.power;
	子弹属性.子弹速度 = Math.floor(手雷属性.velocity * 1.1);
	子弹属性.击中地图效果 = 手雷属性.bullethit;
	子弹属性.Z轴攻击范围 = 手雷属性.bulletsize;
	子弹属性.击倒率 = 手雷属性.impact;
	子弹属性.击中后子弹的效果 = 手雷属性.targethit;
	子弹属性.子弹敌我属性 = 子弹敌我属性;
	子弹属性.发射者 = _parent._name;
	子弹属性.shootX = shootX;
	子弹属性.shootY = shootY;
	子弹属性.shootZ = _parent.Z轴坐标;
	if (_parent.上行)
	{
		子弹属性.角度偏移 = -30;
	}
	else if (_parent.下行)
	{
		子弹属性.角度偏移 = 30;
	}
	else
	{
		子弹属性.角度偏移 = 0;
	}
	// 伤害类型设置
	if (_parent.手雷伤害类型)
	{
		子弹属性.伤害类型 = _parent.手雷伤害类型;
	}
	if (_parent.手雷魔法伤害属性)
	{
		子弹属性.魔法伤害属性 = _parent.手雷魔法伤害属性;
	}
	if (_parent.手雷毒)
	{
		子弹属性.毒 = _parent.手雷毒;
	}
	if (_parent.手雷吸血)
	{
		子弹属性.吸血 = _parent.手雷吸血;
	}
	if (_parent.手雷击溃)
	{
		子弹属性.血量上限击溃 = _parent.手雷击溃;
	}
	子弹属性.手雷检测 = true;
	_root.子弹区域shoot传递(子弹属性);
	换弹夹();
}
function 换弹夹()
{
	if (_root.控制目标 == _parent._name)
	{
		var 剩余显示手雷数 = _root.物品栏.装备栏.getValue("手雷");
		if (剩余显示手雷数 > 0)
		{
			_root.物品栏.装备栏.addValue("手雷",-1);
			剩余显示手雷数--;
			_root.玩家信息界面.玩家必要信息界面.弹夹数 = 剩余显示手雷数;
		}
	}
	gotoAndPlay("换弹夹");
}

if (_parent.是否为敌人 == true)
{
	子弹敌我属性 = false;
}
else
{
	子弹敌我属性 = true;
}
var myPoint = {x:this.枪._x, y:this.枪._y};
this.枪.localToGlobal(myPoint);
_root.gameworld.globalToLocal(myPoint);
shootX = myPoint.x;
shootY = myPoint.y;

剩余弹夹数 = _root.物品栏.装备栏.getValue("手雷");
if (剩余弹夹数 <= 0)
{
	_root.发布消息("手雷耗尽！");
	_parent.攻击模式切换("空手");
}
else
{
	射击();
}

if (_root.控制目标 == _parent._name && _root.物品栏.装备栏.isEmpty("手雷"))
{
	_parent.攻击模式切换("空手");
}

_parent.手雷动作类型 = _parent.手雷动作类型 ? _parent.手雷动作类型 : "";
_parent.手雷抛出模式 = _parent.手雷抛出模式 ? _parent.手雷抛出模式 : "高抛";
跳转帧 = _parent.手雷动作类型 + _parent.手雷抛出模式;
this.gotoAndPlay(跳转帧);

if (_parent.上行)
{
	角度偏移 = -30;
}
else if (_parent.下行)
{
	角度偏移 = 30;
}
else
{
	角度偏移 = 0;
}

